#!/usr/bin/env python3
import hashlib
import struct

key = b'iTAVgXLdWAkxSL5aEiiWyZqTaj15BHZZ'
hash_key = hashlib.md5(key).digest().hex().encode()

enc_path = [0x71, 0x59, 0x6a, 0x6d, 0x16, 0x53, 0x10, 0x16, 
            0x3f, 0x40, 0x42, 0x38, 0x75, 0x5d, 0x01, 0x42, 
            0x0c, 0x04, 0x5c, 0x16, 0x12, 0x6b, 0x4d, 0x17, 
            0x05, 0x5a, 0x17, 0x56, 0x4a, 0x5b, 0x47, 0x45, 
            0x1c, 0x17, 0x4e, 0x4c]

dec_path = []

for i in range(len(enc_path)):
    dec_path.append(enc_path[i] ^ hash_key[i % len(hash_key)])

dec_path = bytes(dec_path)

print(dec_path)

enc_data = bytes.fromhex('' +
                          '' +
                          '' +
                          '' +
                          '' +
                          '' +
                          '' +
                          '' +
                          '' +
                          '' +
                          '')

dec_data = []

while len(enc_data) != 0:
    data_len = struct.unpack('<I', enc_data[:4])[0]
    data = enc_data[4:4 + data_len]
    enc_data = enc_data[4 + data_len:]

    for i in range(len(data)):
        dec_data.append(data[i] ^ hash_key[i % len(hash_key)])

dec_data = bytes(dec_data)

print(dec_data)
